import logo from './logo.svg';
import './App.css';


function App() {
  return (
    <>
     <form><br></br>
      Name :- 
      <input type='text' placeholder='Username'></input>
      Email :- 
      <input type='email' placeholder='name@gamil.com'></input>
      Mobile
      <input type='number' placeholder='(00) 12364789356'></input>
     </form>

    </> );
}

export default App;
